B.Hd=new A.fd("Lighthouse Project","The Lighthouse Project aims to revolutionise personal productivity through powerful tools and documentation.","In the Lighthouse Project, my main focus is the Lighthouse web app \u2014 a powerful all-in-one, free-forever tool that helps you organise the various sectors of your life in a sustainable manner. The focus of the web app is to be \"intelligent\", automating as much of the administrative work as possible so that you can focus on actually completing your tasks. The web app is so feature-rich that I've also compiled a repository of documentation that guide the user through using different features of Lighthouse at different levels of depth. From bird's-eye-view for beginners to detailed feature-specific guides for the familiar, the documentation caters to users of all backgrounds. Further, elaborate guides detailing the design process and development decisions also make it easy for other developers to understand how Lighthouse came into being, allowing them to also improve on the product if needed.\n\nFrom its inception in 2021 to its first stable release in 2024, the Lighthouse Project is one of my two flagship projects.",B.yO,B.zg,"figma_design_system",B.Fb,B.IG)
